import classes from "./Users.module.css";
import {NavLink} from "react-router-dom";
import React from "react";
import Pagination from "./Paginator";

const User = () =>{

        return <div className={classes.user_card_wrap}>
            <Pagination curentPage={ props.curentPage} onPageChanged={ props.onPageChanged}/>
            {
                props.users.map(u => <User user = {u} key={u.id} followingInProgress={props.followingInProgress} fallow={props.fallow} unfallow={props.unfallow}/>)
            }
        </div>
    }
export default User;
